import React, {useState, useEffect} from 'react';
import clsx from 'clsx';
import { Typography, Grid } from "@material-ui/core"
import { createStyles, Theme, makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';

// import uuid from "uuid";
// import dynamic from 'next/dynamic'
// const uuid=dynamic(import ('uuid'),{ssr:false})


const useStyles = makeStyles(theme => ({
    root: {
        width: '100%',
        maxWidth: 500,
        backgroundColor: theme.palette.background.paper,
      },

    posts: {
        marginTop: theme.spacing(2)
    },
    post: {
        marginBottom: theme.spacing(2)
    }
}));


interface InfoProps {
    className ?: string
    user? : User
}

interface User {
    address?: String
    avatar?: String
    birthday?: String
    email?: String
    facebook?: String
    first_name?: String
    gender: String
    google_id: String
    id: String
    intro: String
    last_name: String
    phone: String
    mobile: String
    skype: String
    username: String
    viber: String
    website: String
    zalo: String
    created_at: String
    updated_at: String
}

const Info: React.FunctionComponent<InfoProps> = (props: InfoProps) => {
    const { className } = props
    const classes = useStyles()
    return (
        <div className={clsx(classes.root, className)}>
            <List component="nav" className={classes.root} dense={true} aria-label="mailbox folders">
                <ListItem button divider={true}>
                    <ListItemText primary="Nguyễn Phi Hùng" />
                </ListItem>
                <Divider />
                <ListItem button divider={true}>
                    <ListItemText primary="12 Khuất Duy tiến, Thanh Xuân Trung, Thanh Xuân, Hà Nội" />
                </ListItem>
                <Divider />
                <ListItem button divider={true}>
                    <ListItemText primary="1990" />
                </ListItem>
                <ListItem button divider={true}>
                    <ListItemText primary="vanthanhbds2710@gmail.com" />
                </ListItem>
                <Divider/>
                <ListItem button divider={true}>
                    <ListItemText primary="Nguyễn Phi Hùng" />
                </ListItem>
                <Divider />
                <ListItem button divider={true}>
                    <ListItemText primary="Nữ" />
                </ListItem>
                <Divider />
                <ListItem button divider={true}>
                    <ListItemText primary="0987654321" />
                </ListItem>
                <ListItem button divider={true}>
                    <ListItemText primary="Tốt nghiệp ĐH Ngoại thương, chuyên viên tư vấn bất động sản chuyên nghiệp 10 năm kinh nghiệm trong nghề" />
                </ListItem>
                <Divider/>
            </List>
        </div>
    );
};


export default Info;
